const Fetch = () => {
  const [photos, setPhotos] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/query-1')
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data[0]);
        setPhotos(data[0]);
      });
  }, []);
  return (
    <div>
      
      {photos.map((photo) => (
      
        <table>
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Username</th>
          </tr>
        </thead>
        <tbody>
            
        </tbody>
       </table>
      
      ))}
    </div>
  );
};
export default Fetch;
